import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Route, Switch } from 'react-router-dom';

const App = () => (
  <>
    <Switch>
      <Route path="/" exact component={Homepage}/>
      <Route path="/about" component={About} />
      <Route path="/contact" component={Contact} />
     </Switch>
  </>
)

export default App;
